import React from 'react';
const ProductsPage = () => {
const products = [
{ id: 1,
   name: 'Nalgene Water Bottle - On the Fly', 
   price: $17

  },
{ id: 2, name: 'Product 2', price: 20 },
{ id: 3, name: 'Product 3', price: 30 },
];









return (
<div>
<h1>Products</h1>
<ul>
{products.map((product) => (
<li key={product.id}>
{product.name} - ${product.price}
</li>
))}
</ul>
</div>
);
};
export default ProductsPage;
